plugins/sound.sh.content:
#!/usr/bin/env bash

VOLUME=$(osascript -e "output volume of (get volume settings)")
MUTED=$(osascript -e "output muted of (get volume settings)")

if [[ $MUTED != "false" ]]; then
ICON=""
else
case ${VOLUME} in
  100) ICON="";;
  9[0-9]) ICON="";;
  8[0-9]) ICON="";;
  7[0-9]) ICON="";;
  6[0-9]) ICON="";;
  5[0-9]) ICON="";;
  4[0-9]) ICON="";;
  3[0-9]) ICON="";;
  2[0-9]) ICON="";;
  1[0-9]) ICON="";;
  [0-9]) ICON="";;
  *) ICON=""
esac
fi

sketchybar -m \
--set $NAME icon=$ICON \
--set $NAME label="$VOLUME"

plugins/cpu.sh.content:
#!/usr/bin/env sh

TOPPROC=$(top -l  2 | grep -E "^CPU" | tail -1 | awk '{ print $3 + $5"%" }' | cut -d "." -f1)

sketchybar --set $NAME icon="" label="$TOPPROC%"

plugins/battery.sh.content:
BATT_PERCENT=$(pmset -g batt | grep -Eo "\d+%" | cut -d% -f1)
# CHARGING=$(pmset -g batt | grep "AC Power")
if [[ $CHARGING != "" ]]; then
  sketchybar -m --set battery           \
    icon=""                           \
    label="${BATT_PERCENT}"
  exit 0
fi
case ${BATT_PERCENT} in
   100) ICON=""; COLOR="0xff9ac868";;
    9[0-9]) ICON=""; COLOR="0xff9ac868" ;;
    8[0-9]) ICON=""; COLOR="0xff9ac868" ;;
    7[0-9]) ICON=""; COLOR="0xfffbc62d" ;;
    6[0-9]) ICON=""; COLOR="0xfffbc62d" ;;
    5[0-9]) ICON=""; COLOR="0xfffbc62d" ;;
    4[0-9]) ICON=""; COLOR="0xfffbc62d" ;;
    3[0-9]) ICON=""; COLOR="0xfffbc62d" ;;
    2[0-9]) ICON=""; COLOR="0xfffbc62d" ;;
    1[0-9]) ICON=""; COLOR="0xfff65e51" ;;
    *) ICON=""; COLOR="0xfff65e51"
esac
sketchybar -m --set battery             \
  icon="$ICON"                          \
  label="${BATT_PERCENT}" \
  label.color="$COLOR"                    \
